import React from 'react';
import './portfolio.scss';

const Portfolio = () =>{
    return (
        <>
        <ul className='flex-container'>
            <li className='flex-items'>Project 1</li>
            <li className='flex-items'>Project 2</li>
        </ul>
        </>
    )
};

export default Portfolio;
